import React from 'react';
import Header from './statics/header';
import HomeBanner from './statics/homebanner';
import ProductFeature from './statics/productfeature';
import TimerArea from './statics/timerarea';
import LastestProduct from './statics/latestproduct';
import ClientLogoArea from './statics/clientlogoarea';
import MostProductArea from './statics/mostproductarea';
import Footer from '.statics/footer';
import './App.css';

function App() {
  return (
    <react-fragment> 
      <Header/>  
      <HomeBanner/>
      <ProductFeature/>
      <TimerArea/>
      <LastestProduct/>
      <ClientLogoArea/>
      <MostProductArea/>
    </react-fragment>
  );
}

export default App;
